import React from "react";
import { Link } from 'react-router-dom';

function Home(props) {
    return(
        //The first section, the middle section and the last section of the home page
        <>
        <div className="HeadOne">
          <h1>{props.head}</h1>
          <p>{props.headpara}</p>
        </div>
        <div className="MiddleOne">
          <div className="Guard">
              <img src="./spheres.png" height="200px" width="250px"/>
              <h1>{props.headtwo}</h1>
              <p>{props.headtwopara}</p>
              <div className="grace">
                <button clasName="yipe"><Link to="/shop"><font color="white">{props.btn}</font></Link></button><p id="btnext">{props.midscript}</p>
            </div>  
          </div>
        </div>
        </>
    )
}

export default Home;
